CREATE SEQUENCE IF NOT EXISTS jobs_id_seq
    INCREMENT 1
    START 1
    MINVALUE 1;

CREATE TABLE IF NOT EXISTS jobs (
    id bigint NOT NULL DEFAULT nextval('jobs_id_seq'::regclass),
    created_at timestamp(6) with time zone,
    date_posted date not null,
    description text,
    job_link text,
    job_title character varying(255),
    job_type character varying(255),
    updated_at timestamp(6) with time zone,
    CONSTRAINT jobs_pkey PRIMARY KEY (id),
    CONSTRAINT jobs_job_type_check CHECK (job_type::text = ANY (ARRAY['FULL_TIME'::character varying, 'CONTRACTOR'::character varying, 'PART_TIME'::character varying]::text[]))
);


